import React from "react";
import "./Navbar.css";

const Navbar = props => {
  return (
    <nav class="navbar navbar-light bg-light">
      <a class="navbar-logo" href="/">
        <div width="" height="30" alt="" />
      </a>
      <a class="navbar-brand center" href="/">
        SoundUp
      </a>
    </nav>
  );
};

export default Navbar;
